import React from 'react';
import './NewMobile.css';


const AddNewMobile = (props) => {
    return (
        <div className="NewMobile">
            <header>Add New Mobile</header>
            <form className="NewMobile-Form">
            <label for="brandname">Brand Name: </label>
            <input type="text" id="brandname" name="brandname" /><br></br><br></br><br></br>
            <label for="battery">Battery</label>
            <input type="text" id="batterysize" name="batterysize" /><br></br>
            <label for="size">Size</label>
            <input type="text" id="size" name="size" /><br></br>
            <label for="color">Color</label>
            <input type="text" id="color" name="color" /><br></br>
            <button type="submit" value="submit">Add Mobile</button>
            </form>
        </div>
    )
}

export default AddNewMobile;
